    constructor(){
        super();
        this.state={
            robots:robots,
            searchfield:''
        }
    }
    onSearchChange(event){
        console.log(event.target.value);
    }
    render(){
    return (
        <div className='tc'>
            <h1>Robo Friends</h1>
            <SearchBox searchChange={this.onSearchChange}/>
            <Cardlist robots={this.state.robots}/>
        </div>

    );
    }
}
export default App;
